@Blodwyn_KH69_ @dupontaignan En plus tu sais qui est vulnérable ?
La femme d'un ami 40 ans non vacciné est décédée, mon pote 80 ans et moi 62 ans vaccinés 2 fois à l'astrazenéca on va bien.
C'est la loterie les morts, tous vaccinés tous protégés de faire une forme grave.

@Sofia_Nati_ @Sev_001 @Mediavenir J'habite le trou du cul de la France un petit hameau en Bourgogne et j'ai été vacciné en mai à la pharmacie.
J'étais pas chaud ts les médias parlaient de trhombose, d'effets secondaires etc etc
J'ai vu mon médecin il m'a rassuré, 2 piqûre d'astrazeneca et toujours vivant.
